pub struct Solution {}

impl Solution {
    pub fn find_repeated_dna_sequences(s: String) -> Vec<String> {
        use std::collections::HashSet;

        let mut results = Vec::new();

        if s.len() < 10 {
            return results;
        }

        let mut substrs = HashSet::new();
        for i in 0..(s.len() - 9) {
            let substr = s[i..(i + 10)].to_string();
            if substrs.contains(&substr) && !results.contains(&substr) {
                results.push(substr);
            } else {
                substrs.insert(substr);
            }
        }

        results
    }
}

#[cfg(test)]
mod test {
    use super::Solution;

    #[test]
    fn test_0187() {
        assert_eq!(
            vec!["AAAAAAAAAA".to_string()],
            Solution::find_repeated_dna_sequences("AAAAAAAAAAA".to_string())
        );
        assert_eq!(
            vec!["AAAAACCCCC".to_string(), "CCCCCAAAAA".to_string()],
            Solution::find_repeated_dna_sequences("AAAAACCCCCAAAAACCCCCCAAAAAGGGTTT".to_string())
        );
        assert_eq!(
            vec![] as Vec<String>,
            Solution::find_repeated_dna_sequences("".to_string())
        );
    }
}
